import React, { useEffect } from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import './App.css';
import './timeline.css';
import MyD3Component from './DDDHooksChart';
import TimelineBubble from './timelineBubble';
import LollipopChart from './LollipopChart2';

function App() {

    return (

        <div className="App">
            <Router>
                <div>
                    <ul style={{textAlign: 'left'}}>
                        <li>
                            <Link to="/">Force-Directed</Link>
                        </li>
                        <li>
                            <Link to="/about">Timeline-Bubble</Link>
                        </li>
                        <li>
                            <Link to="/dashboard">Lollipop-Chart</Link>
                        </li>
                    </ul>
                    <hr />
                    <Switch>
                        <Route exact path="/">
                            <MyD3Component />
                        </Route>
                        <Route path="/about">
                            <TimelineBubble />
                        </Route>
                        <Route path="/dashboard">
                            <LollipopChart />
                        </Route>
                    </Switch>
                </div>
            </Router>
        </div>
    );
}

export default App;
